import React from "react";
import { Text, StyleSheet, View, Button, TouchableOpacity } from "react-native";

const HomeScreen = (props) => {
  const { navigate } = props.navigation;
  return <View>
    <Button style={styles.button} title="Go to Components" onPress={()=>navigate('Components')} />
    <Button style={styles.button} title="Go to List" onPress={()=>navigate('List')} />
    <Button style={styles.button} title="Go to Image" onPress={()=>navigate('Image')} />
  </View>
};

const styles = StyleSheet.create({
  button: {
    margin: 10
  }
});

export default HomeScreen;
